5 States Extends Unemployment Benefits to Workers that Lost Jobs Over Vaccine Mandates
Governors in Arkansas, Florida, Iowa, Kansas, and Tennessee have extended unemployment benefits on Tuesday to those who lost their job for refusing a COVID-19 vaccine mandate.

